        }
    }

    render(){
        return(
            <React.Fragment>

                {/* This is  main cover including photo name and job*/}
                <section>
                    <div>photo</div>
                    <div className="">
                        <h3>{this.state.helloYou}</h3>
                        <h5>Front end</h5>
                        <p>Email:{this.state.email}</p>
                    </div>
                </section>

                {/* this is talking about my education and skill */}
                <section className="education">
                    <div className="title">
                        <h3>education</h3>
                    </div>

                    <div className="skill">
                    <h5>Language</h5>
                    <hr/>
